import {Box, Button, ButtonGroup, Flex, Heading, Spacer} from '@chakra-ui/react';

function Navbar(){
    return(
        <Flex bg='transparent' minWidth='100%' alignItems='center' gap='5'>
            <Box p='2'>
                <Heading color='white' > All Matches </Heading>
            </Box>
            <Spacer />
            <ButtonGroup gap='6'>
                <Button bg='transparent'  color='#7b7b7b'> About </Button>
                <Button bg='transparent' color='#7b7b7b'> Contacts </Button>
                <Button bg='transparent' color='#7b7b7b'> Overview </Button>
            </ButtonGroup>
        </Flex>

    )
}

export default Navbar;
